const FFfooter = () => {
  return (
    <>
       <div class="container">
      <footer class="py-2">
        <div class="row">
          <div class="col-6 col-md-2 mb-3">
            <h5>Section</h5>
            <ul class="nav flex-column">
              <li class="nav-item mb-2"><a href="#" class="nav-link p-0 text-body-secondary">Home</a></li>
              <li class="nav-item mb-2"><a href="#" class="nav-link p-0 text-body-secondary">Features</a></li>
              <li class="nav-item mb-2"><a href="#" class="nav-link p-0 text-body-secondary">Pricing</a></li>
              <li class="nav-item mb-2"><a href="#" class="nav-link p-0 text-body-secondary">FAQs</a></li>
              <li class="nav-item mb-2"><a href="#" class="nav-link p-0 text-body-secondary">About</a></li>
            </ul>
          </div>
    
          <div class="col-6 col-md-2 mb-3">
            <h5>Services</h5>
            <ul class="nav flex-column">
              <li class="nav-item mb-2"><a href="#" class="nav-link p-0 text-body-secondary">Home</a></li>
              <li class="nav-item mb-2"><a href="#" class="nav-link p-0 text-body-secondary">Features</a></li>
              <li class="nav-item mb-2"><a href="#" class="nav-link p-0 text-body-secondary">Pricing</a></li>
              <li class="nav-item mb-2"><a href="#" class="nav-link p-0 text-body-secondary">FAQs</a></li>
            </ul>
          </div>
    
          <div class="col-6 col-md-2 mb-3">
            <h5>Contacts</h5>
            <ul class="nav flex-column">
              <li class="nav-item mb-2"><a href="#" class="nav-link p-0 text-body-secondary">Home</a></li>
              <li class="nav-item mb-2"><a href="#" class="nav-link p-0 text-body-secondary">Features</a></li>
              <li class="nav-item mb-2"><a href="#" class="nav-link p-0 text-body-secondary">Pricing</a></li>
            </ul>
          </div>
    
          <div class="col-md-5 offset-md-1 mb-3">
            <form>
              <h3>Give Feedback to our Mail</h3>
              <p>Monthly digest of what's new and exciting from us.</p>
              <div class="d-flex flex-column flex-sm-row w-100 gap-2">
                <label for="newsletter1" class="visually-hidden">Email address</label>
                <input id="newsletter1" type="text" class="form-control" placeholder="Email address"/>
                <button class="btn btn-outline-warning" type="button">Subscribe</button>
              </div>
            </form>
          </div>
        </div>
    
        <div class="parent-list d-flex flex-column  justify-content-center align-items-center py-4 my-0 border-top">
         <p> <strong>Anime<span style="color: orange;">Tank</span></strong>© 2023 Company, Inc. All rights reserved.</p>
          <ul class="d-flex justify-content-center align-item-center list-unstyled px-5 my-0">
            <li class="ms-3"><a class="link-body-emphasis" href="#"/>
            <i class="fa-brands fa-twitter fa-lg" style="color: #0a0a0a;"></i></li>
            <li class="ms-3"><a class="link-body-emphasis" href="#"/>
            <i class="fa-brands fa-facebook fa-lg" style="color: #0a0a0a;"></i></li>
            <li class="ms-3"><a class="link-body-emphasis" href="#"/>
            <i class="fa-brands fa-instagram fa-lg" style="{color: #0a0a0a;"></i></li>
          </ul>
        </div>
      </footer>
    </div>

    </>
  )
}

export default FFfooter;
